/* return 0 if not found, else return token value */

int binarySearch (char * key, struct table * mytable, int low, int high) {

    int mid;
    int tmpVal;

    while(low <= high) {

        mid = (low + high) / 2;

        tmpVal = strcmp (mytable[mid].keyword, key);

        if( tmpVal > 0 ) {
            high = mid - 1;
        } else if( tmpVal < 0) {
            low = mid+1;
        } else {

            return mytable[mid].token;

        }

    }
    
    return 0;

}

